import React, {useEffect, useState,} from 'react';
import { useParams } from "react-router-dom"



const Dima = () => {
    let {slug} = useParams()
    const [users, setUsers] = useState([])
    const fetchData = async () => {

      const response = await fetch("http://localhost:8000/api2/pages/dima/")
      const data = await response.json()
      setUsers(data)
      }




  useEffect(() => {
    fetchData()
  }, [])


    return (

        <div>        

                <ul>

                        <li key={users.id}>{users.title} @ {users.meta && users.meta.slug}

                        <h3>ID: {users.body.type === 'image_text' && (<img src={users.body.value.image.url}/>)} </h3>

                        <p>{users.body && users.body[2].value.image.url}</p>   



                        </li>


                </ul>

    </div>
  )
}



  export default Dima;
